import React from 'react';
import ChapterLink from './ChapterLink';

const MainMenu = () =>
{
    return (
        <div className="ui container">
            <div className="ui center aligned huge header">Life Chapters</div>
            <div className="ui center aligned three column centered grid">
                <div className="stretched row">
                    <ChapterLink linkText="/faces" chapterName="Faces" chapterImg="column"/>
                    <ChapterLink linkText="/family" chapterName="Family" chapterImg="column"/>
                    <ChapterLink linkText="/moments" chapterName="Moments" chapterImg="column"/>
                </div>
                <div className="stretched row">
                    <ChapterLink linkText="/music" chapterName="Music" chapterImg="column"/>
                    <ChapterLink linkText="/work" chapterName="Work" chapterImg="column"/>
                    <ChapterLink linkText="/travelling" chapterName="Travelling" chapterImg="column"/>
                </div>            
            </div>            
        </div>
    );
};

export default MainMenu;
